import React, {Component} from "react";
import {IconButton, Snackbar} from "@material-ui/core";
import {Close as CloseIcon} from "@material-ui/icons";
import './SnackbarWrapper.css';

class SnackbarWrapper extends Component {
    render() {
        return (
            <Snackbar
                anchorOrigin={{
                    vertical: 'top',
                    horizontal: 'right'
                }}

                open={this.props.snackOpened}
                autoHideDuration={5000}
                onClose={this.props.handleSnackClose}
                ContentProps={{
                    'aria-describedby': 'message-id',
                    'background-color': 'red'
                }}
                action={[
                    <IconButton
                        key="close"
                        aria-label="Close"
                        color="inherit"
                        onClick={this.props.handleSnackClose}
                    >
                        <CloseIcon/>
                    </IconButton>,
                ]}
                message={<span id="message-id" className={this.props.snackType}>{this.props.snackMessage}</span>}
            />
        );
    }
}

export default SnackbarWrapper;
